import React, { Component } from 'react';
import './App.css';
import { Connector } from 'mqtt-react';

import _MessageContainer from './mqtt/MessageContainer';
import {subscribe} from 'mqtt-react';

const MessageContainer = subscribe({topic: '@restaurant/buttons'})(_MessageContainer);


class App extends Component {
  render() {
    return (
      <Connector mqttProps={
            {
                host: 'ws://soldier.cloudmqtt.com/',
                port:33111,
                username: 'uydfkyfd',
                password: 'BdDWtCLZIxnk',
                defaultExpires: 1000 * 3600 * 24
            }
        }>
        <div className="App">
          <div className="App-header">
          </div>
          <MessageContainer/> 
        </div>
      </Connector>
    );
  }
}

export default App;
